import Nav from "./Nav";
import React, { Component } from "react";
import Foot from "./Foot";

export default class Layout extends Component {
  render() {
    return (
      <div>
        <Nav />
        {this.props.children}
        <Foot></Foot>
      </div>
    );
  }
}
